const initialData = {
    symptomsArray: []
}

const SymptomsReducer = (state = initialData, action) => {
    switch (action.type) {
        case 'ADD_SYMPTOMS':
            const data  = action.payload;
            return {
                ...state,
                symptomsArray: data
            }
        default:
            return state;
    }
}
export default SymptomsReducer
